package leetcode

/**
 * 55. 跳跃游戏
 * https://leetcode-cn.com/problems/jump-game/
 * 给定一个非负整数数组，你最初位于数组的第一个位置。

数组中的每个元素代表你在该位置可以跳跃的最大长度。

判断你是否能够到达最后一个位置。

示例 1:

输入: [2,3,1,1,4]
输出: true
解释: 我们可以先跳 1 步，从位置 0 到达 位置 1, 然后再从位置 1 跳 3 步到达最后一个位置。
示例 2:

输入: [3,2,1,0,4]
输出: false
解释: 无论怎样，你总会到达索引为 3 的位置。但该位置的最大跳跃长度是 0 ， 所以你永远不可能到达最后一个位置。

来源：力扣（LeetCode）
链接：https://leetcode-cn.com/problems/jump-game
著作权归领扣网络所有。商业转载请联系官方授权，非商业转载请注明出处。
 **/
object JumpGame {

    class Solution {

        private var canJump = false
        /**
         *  思路：这一题跟加油站很相似
         *  1. 从startPos = 0开始
         *  2. 然后遍历每一步所能到的位置
         *  3. 如果最后的startPos 大于等于 数组的end值 泽可以跳跃
         *
         *  不过很遗憾 测试用例超出 stackoverflow
         */
        fun canJump(nums: IntArray): Boolean {
            this.jump(0,nums)
            return canJump
        }

        fun jump(startPos: Int,nums: IntArray){
            if (canJump) return
            if (startPos >= nums.size - 1) {
                canJump = true
                return
            }
            for (i in 1 .. nums[startPos]) {
                jump(startPos + i,nums)
            }
        }

        /**
         * 贪心算法一次遍历：
         * 官方题解，最后一个答案
         * https://leetcode-cn.com/problems/jump-game/solution/tiao-yue-you-xi-by-leetcode/
         *  从最后往前遍历，依次往前判断是否能到lastPos 如果可以泽更新lastPos,最终判断从0是否能到最后
         */
        fun canJump2(nums: IntArray): Boolean {
            var lastPos = nums.size - 1
            for (i in lastPos -1 downTo 0) {
                if (nums[i] + i >= lastPos) {
                    lastPos = i
                }
            }
            return lastPos == 0
        }

}

